INSERT INTO `test_paper` VALUES ('1', '用友认为商业的成功最后都决定于其带给____的价值与贡献。', '组织', '个人', '社会', '公司', 'c');
INSERT INTO `test_paper` VALUES ('2', '用友能够取得商业上的巨大成功，是因为在我们所处的时代，做了具有重要的事情，创造了巨大的____。', '创新意义，创新价值', '个人意义，个人价值', '历史意义，历史价值', '社会意义，社会价值', 'd');
INSERT INTO `test_paper` VALUES ('3', '在用友文化理念里，企业是一个有生命的机体，像人一样，需要____和____。', '创新驱动，意志指引', '梦想驱动，信念指引', '能量驱动，创新指引', '意志驱动，能量指引', 'b');
INSERT INTO `test_paper` VALUES ('4', '用友的使命是____。', '用创想与技术推动商业和社会进步', '用梦想与技术推动商业和社会进步', '用创想与信息技术推动商业和社会进步', '用梦想与技术推动企业和公共组织进步', 'a');
INSERT INTO `test_paper` VALUES ('5', '用友的愿景是成为全球领先的____提供商。', '企业与公共组织软件、云服务、金融服务', '网络服务、政务服务、组织管理软件', '企业与公共组织软件、政务服务、组织管理软件', '企业与公共组织软件、云服务、政务服务', 'a');
INSERT INTO `test_paper` VALUES ('6', '在用友的愿景中提到，用友希望成为员工____的平台。', '积极工作，成就企业，成就社会', '快乐工作，成就事业，分享成功', '成就个人，分享创新，分享成就', '快乐工作，成就企业，分享成就', 'b');
INSERT INTO `test_paper` VALUES ('7', '只有把____作为用友新发展阶段的核心业务，才能如同用友的愿景一样，实现用友成为全球领先的目标。', '软件、网络服务、政务服务', '软件、政务服务、组织管理', '软件、云服务、金融服务', '软件、云服务、政务服务', 'c');
INSERT INTO `test_paper` VALUES ('8', '用友认为做到____是新的发展阶段用友公司必须达成的目标。', '行业领先', '亚洲领先', '宇宙领先', '全球领先', 'd');
INSERT INTO `test_paper` VALUES ('9', '用友文化3.0中提出，____是公司赖以可持续发展的信念基石。 ', '用友文化3.0', '核心价值观', '使命与愿景', '“梦、道、力”', 'b');
